// functionality working
import mongoose from "mongoose";

const userSchema = new mongoose.Schema(
  {
    name: {
      type: String,
      required: true,
    },
    email: {
      type: String,
      required: true,
      unique: true,
    },

    password: {
      type: String,
      required: true,
    },

    address: {
      type: Object,
      default: { line1: "", line2: "" },
      required: true,
    },

    image: {
      type: String,
      default:
        "data:image/jpeg;base64,",
      required: true,
    },

    gender: {
      type: String,
      default: "not selected",
    },

    dob: {
      type: String,
      default: "not selected",
    },

    phone: {
      type: String,
      default: "+917386756518",
    },
  },
  { minimize: false },
  {
    timestamps: true,
  }
);

const userModel = mongoose.models.User || mongoose.model("User", userSchema);
export default userModel;
